import React, { Component } from "react";
import { Nav } from "react-bootstrap";
import { withRouter } from "react-router";
import "../style/Dashboard.css";
import { LinkContainer } from "react-router-bootstrap";
import SideMenuElement from "../components/SideMenuElement";
import { FA_USERS } from "../constants/fa-icons";
import { SIDE_MENU } from "../constants/side-menu";

class SideMenu extends Component {
  constructor(props) {
    super(props);

    this.onSelectHandler = this.onSelectHandler.bind(this);
  }

  onSelectHandler() {
    this.props.onSideMenuSelect("Student");
  }

  render(key) {
    const elements = SIDE_MENU;

    return (
      <Nav
        className="sidebar"
        activeKey="/home"
        onSelect={(key) => this.onSelectHandler(key)}
      >
        {elements.map((element) => (
          <SideMenuElement
            key={element.id}
            component="studentform"
            componentName={element.name}
            componentIcon={element.icon}
          ></SideMenuElement>
        ))}
      </Nav>
    );
  }
}

SideMenu = withRouter(SideMenu);
export default SideMenu;
